import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./app/styles/App.css";
import HomePage from "./app/pages/HomePage/HomePage.js";
import TourPage from "./app/pages/TourPage/TourPage.js";
import routes from "./app/routes/index.js";
function App() {
  return (
    <div>
      <Router>
        <Routes></Routes>
      </Router>
    </div>
  );
}

export default App;
